Adelaide: World's Smart Cities

Travel Documentary hosted by Stephen Anderton, published by National Geographic in 2014 - English narration


Information
------------------------------

Adelaide: World's Smart Cities
Nat Geo explores how Adelaide has used its multi-cultural population, astonishing landscapes, architecture and even its wine culture, to form a city that's alive and vibrant.
The city centre is surrounded by parklands and is a blend of historic buildings, wide streets, parklands, cafes and restaurants. Adelaide is easy to get around with rolling hills to the east and beaches to the west. With a population of slightly more than one million, Adelaide is the &quot;20 minute city&quot;. The airport is only seven kilometres from Adelaide city. The Adelaide Hills and major beaches are less than half an hour away by car. That's what we call liveable!

